import React from 'react';
import {   StyleSheet, View } from 'react-native';



function About(){
  return(
    <View style={styles.buttonsRow}>
        <Text>
        about
        </Text>
        
    </View>
  )
}

const styles = StyleSheet.create({
  buttonsRow:{
    flexDirection:'row',
    alignSelf:'stretch',
    justifyContent:'space-between',
    marginTop:80,
    marginBottom:30
  },
});


export default About;
